import logo from './logo.svg';
import './App.css';

function App() {
  return (
   <div className="App">
      <h2>Md Ismail</h2>
      {5+6}
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        Md Ismail Saheb
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn With Ismail Saheb
      </a>
  </header>
  </div>
  );
}

export default App;
